          <Col sm="8">لديك اليوم 5 مواعيد </Col>
        </Row>

        <Row className="justify-content-center">
          <Col sm="8">
            <div className="rectangle"> 
            </div>
          </Col>
        </Row>
        <Row className="justify-content-center">
          <Col sm="8"> <button> مسح البيانات </button></Col>
          <Col sm="8"> <button> مسح البيانات </button></Col>
        </Row>

      </Container>
